import { Try } from './Try';
import { expect, test } from "vitest";
test('try without exception', () => {
    expect(Try(() => 'yalla').withDefault('neh')).toBe('yalla');
});
function throwErr() {
    throw new Error('ouch');
}
function throwString() {
    throw 'ouch';
}
test('throw Error', () => {
    expect(Try(throwErr).match(() => 'neh', (err) => err.message)).toBe('ouch');
});
test('throw string', () => {
    expect(Try(throwString).match(() => 'neh', (err) => err.message)).toBe('ouch');
});
